import React from "react";
import './App.css';
import { Routes, Route } from "react-router-dom";
import Register from "./auth/Register.jsx";

function App() {
  return (
    <React.Fragment>
      <main role="main">
      <div className="container">
        <Routes>
          <Route path="/" element={<Register/ >}></Route>
        </Routes>
      </div>
      </main>
    </React.Fragment>
  );
}

export default App;
